import React from "react";
import wave from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/waving-hand.png";
import flag_ca from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/flag-canada_.png";
import heart from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/heart.png";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/home_pic.png";
const Home = (props) => {
  return (
    <div id="home" className=" #home">
      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                  <CommonParent
                    name={
                      <h1>
                        Hello! my name is{" "}
                        <span className="navbar-brand">Maah Asghar.</span>
                      </h1>
                    }
                    text={
                      <h1>
                        I am a{" "}
                        <span className="navbar-brand"> Software Engineer</span>
                        and an
                        <span className="navbar-brand"> Illustrator</span>
                        based in London, Ontario, Canada.
                      </h1>
                    }
                    imgsrc={web}
                    visit1="/#projects"
                    btname1="View Projects"
                    visit2="/#resume"
                    btname2="View Resume"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
